@Helenknows: I know what happened, Margot. I know what you did"}

{"highlighted_text":"drag her features down towards a terrible gape of pain.



A quiet but high-pitched rasping sound coming from the other womans throat.



Margot looked a hundred years old. She looked haunted. No, not that - she looked hunted"}

{"highlighted_text":"But look, are you sure youre ok? Did something just happen?



Here it was again, the chance to unburden, but I still didnt take it.



Thats exactly what she wants - something to hold over me"}

{"highlighted_text":"A shape detached itself from the shadows on the landing at the top of the stairs.



Please, no.



I knew what came next. Of course I did. I had been re-living it for almost twenty years"}
